import React from 'react'
import HeaderLogo from '../images/star-wars.svg'
import styled from 'styled-components';

const StyledLogoContainer = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    height: 130px;
`;

const StyledLogo = styled.img`
    filter: invert(91%) sepia(41%) saturate(2104%) hue-rotate(334deg) brightness(104%) contrast(102%);
    filter: invert(98%) sepia(80%) saturate(6555%) hue-rotate(335deg) brightness(104 %) contrast(100 %);
    // fill: #ffe81f;
    // width: 100%;
    width: 450px;
    // max-width: 45rem;
`;

const HeaderSection = () => {
    return (
        <StyledLogoContainer >
           <StyledLogo src={HeaderLogo} alt="header logo"/>
        </StyledLogoContainer >
    )
}

export default HeaderSection
